Sure, here's an example Java code for summing up an array:

```java
public class SumArray {
 public static void main(String[] args) {
 int[] arr = {1, 2, 3, 4, 5};
 int sum = 0;

 for (int i = 0; i < arr.length; i++) {
 sum += arr[i];
 }

 System.out.println("The sum of the array is: " + sum);
 }
}
```

In this code, we first declare an integer array `arr` with some values. We then declare an integer variable `sum` and initialize it to 0.

We then use a `for` loop to iterate through each element of the array and add it to the `sum` variable. Finally, we print out the sum of the array using `System.out.println()`.
